import React from 'react';
import yamheru from './yamheru.png';
import './Logo.css';

const Logo = () => {
  return (
    <div className='ma4 mt0'>
        <div className="Tilt-inner pa3">
          <img style={{paddingTop: '5px'}} alt='logo' src={yamheru}/>
        </div>

    </div>
  );
}

export default Logo;
